import React, {useState} from 'react';
import imageDefault from './Button_3_Unlock_Default.png';
import imageDefault2x from './Button_3_Unlock_Default@2x.png';
import imageHover from './Button_3_Unlock_hover.png';
import imageHover2x from './Button_3_Unlock_hover@2x.png';
import imageSelected from './Button_3_Unlock_selected.png';
import imageSelected2x from './Button_3_Unlock_selected@2x.png';
import './ButtonUnlockThree.css';

type Props = {
  className?: string;
  onClick?: () => void;
};

function ButtonUnlockThree(props: Props): JSX.Element {
  const [hover, setHover] = useState(false);
  const [push, setPush] = useState(false);
  return (
    <img
      className={`btn-unlock btn-unlock-three ${props.className ?? ''}`}
      src={push ? imageSelected : hover ? imageHover : imageDefault}
      srcSet={push ? imageSelected2x : hover ? imageHover2x : imageDefault2x}
      onMouseOver={() => setHover(true)}
      onMouseOut={() => setHover(false)}
      onMouseDown={() => setPush(true)}
      onMouseUp={() => setPush(false)}
      onClick={props.onClick}
    />
  );
}

export default ButtonUnlockThree;
